import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
        container:{
                flexDirection: 'row',
                justifyContent: 'space-between',
                alignItems: 'center',
                backgroundColor: '#6400FF'
        },
        button:{
                paddingVertical: 10,
                paddingHorizontal: 20
        },
        title:{
                fontSize: 18,
                fontWeight: 'bold',
                color: 'white'
        },
        
})

export default styles;
